// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;

import './Notify.sol';
import './Inspect.sol';
import './JudgeByMedia.sol';

contract DefendContract is Notify, Inspect, JudgeByMedia{
    using SafeMath for uint;
    using Report for Report.link;
    

    function holdToken(DefenderToken _token) public{
        token = _token;
    }
    
    modifier onlyRepresentor(){
        require(msg.sender == representor, "");
        _;
    }

    constructor() public {
        representor = msg.sender;
        compenSationQueue = new Queue();
    }

    /* Getter function for pending money that give to reporter and inpector */
    function getBalance() public view returns (uint256 bal){
        bal = address(this).balance;
    }

   
    function getMeta(bytes32 name, bytes memory domain) public pure returns (bytes memory){
        return Report.makeMetaDataForLink(name, domain);
    }


}
